import React from 'react';

import Link from 'next/link';
import Head from 'next/head';

import WithAnalytics from '../src/hocs/WithAnalytics';

const Home = () => (
  <>
    <Head>
      <title>Home</title>
    </Head>
    <img src="/static/panda.jpeg" />
    <h1>Hello World</h1>
    <Link href="/users" >
      <a>Ir para Membros</a>
    </Link>
  </>
);

export default WithAnalytics()(Home);
